import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    // Header
    <div className="App">
      <div className="container" style={{paddingTop: "3%"}}>
        <div className="row justify-content-md-center">
          <div className="col-3-lg">
          </div>
          <div className="col-6-lg">
            Cocktails
          </div>
          <div className="col-3-lg">
          </div>
        </div>

      {/* Body */}
        <div className="row justify-content-md-center">
          <div class="col-6-lg">
            Cocktail Index
          </div>
          <div className="col-4-lg">
            Cocktail Info
          </div>
          <div className="col-4-lg">

          </div>
        </div>
</div>
    </div>
  );
}

export default App;
